import React from 'react';
import './index.css';


class Blog extends React.Component{
    render(){
        return(
            <div className='blocks'>
                <div>Some Text</div>
                <div>Some Text</div>
                <div>Some Text</div>
            </div> 
        );
    }
}

export default Blog;
